import React, {useState, useEffect, Link } from 'react';

import 'styles/page/model.css'
import ModelNav from 'components/Model_nav'

function Model911(){
    const [model, setFeeds] = useState([]);

    useEffect(() => {
        fetch("model911.json")
        .then((res) => res.json())
        .then((data) => setFeeds(data));
    }, [])
    console.log(model)

    return(
        <section>
            <ModelNav />
            {model.map((item) => (
                <div className='model_info'>
                    <div>
                        <img src={item.url} />
                        <p>{item.model}</p>
                        <p>{item.price}</p>
                    </div>
                </div>
            ))}
        </section>
    )
}

export default Model911;
